import React, { useState } from 'react';
import axios from 'axios';

const CompanyDashboard: React.FC = () => {
  const [staffId, setStaffId] = useState('');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [password2, setPassword2] = useState('');
  const [error, setError] = useState<string | null>(null);
  const [success, setSuccess] = useState<string | null>(null);
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setError(null);
    setSuccess(null);
    setLoading(true);
    try {
      const token = localStorage.getItem('authToken');
      if (!token) {
        setError('You must be logged in as a company to register staff.');
        setLoading(false);
        return;
      }
      const response = await axios.post(
        'http://127.0.0.1:8000/api/client/add-staff/',
        {
          staff_id: staffId,
          name,
          email,
          password,
          password2,
        },
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );
      setSuccess('Staff registered successfully!');
      setStaffId('');
      setName('');
      setEmail('');
      setPassword('');
      setPassword2('');
    } catch (err: any) {
      if (axios.isAxiosError(err) && err.response) {
        const errorData = err.response.data;
        if (typeof errorData === 'object' && errorData !== null) {
          const messages = Object.entries(errorData).map(([key, value]) => {
            if (Array.isArray(value)) {
              return `${key}: ${value.join(' ')}`;
            }
            return `${key}: ${value}`;
          }).join(' ');
          setError(messages || 'Registration failed. Please check your input.');
        } else if (errorData.detail) {
          setError(errorData.detail);
        } else {
          setError('Registration failed. An unexpected error occurred.');
        }
      } else {
        setError('An unexpected error occurred. Please try again.');
      }
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-xl mx-auto mt-8 p-6 bg-white rounded shadow">
      <h1 className="text-2xl font-bold mb-4">Company Dashboard</h1>
      <p className="mb-6 text-gray-700">Register a new staff account for your company below.</p>
      <form onSubmit={handleSubmit} className="space-y-4">
        {error && <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-2 rounded">{error}</div>}
        {success && <div className="bg-green-100 border border-green-400 text-green-700 px-4 py-2 rounded">{success}</div>}
        <div>
          <label className="block text-sm font-medium text-gray-700">Staff ID</label>
          <input type="text" value={staffId} onChange={e => setStaffId(e.target.value)} required className="mt-1 block w-full border border-gray-300 rounded px-3 py-2" />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Name</label>
          <input type="text" value={name} onChange={e => setName(e.target.value)} required className="mt-1 block w-full border border-gray-300 rounded px-3 py-2" />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Email</label>
          <input type="email" value={email} onChange={e => setEmail(e.target.value)} required className="mt-1 block w-full border border-gray-300 rounded px-3 py-2" />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Password</label>
          <input type="password" value={password} onChange={e => setPassword(e.target.value)} required className="mt-1 block w-full border border-gray-300 rounded px-3 py-2" />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Confirm Password</label>
          <input type="password" value={password2} onChange={e => setPassword2(e.target.value)} required className="mt-1 block w-full border border-gray-300 rounded px-3 py-2" />
        </div>
        <button type="submit" disabled={loading} className="w-full bg-blue-600 text-white py-2 rounded hover:bg-blue-700 disabled:bg-gray-400">
          {loading ? 'Registering...' : 'Register Staff'}
        </button>
      </form>
    </div>
  );
};

export default CompanyDashboard;
